import React from 'react';

const ViewStudent = () => {
  // Placeholder data
  const students = [
    { id: 1, name: 'John Doe', standard: '10' },
    { id: 2, name: 'Jane Smith', standard: '9' }
  ];

  return (
    <div>
      <h2>View Students</h2>
      <table border="1" cellPadding="10">
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Standard</th>
          </tr>
        </thead>
        <tbody>
          {students.map(s => (
            <tr key={s.id}>
              <td>{s.id}</td>
              <td>{s.name}</td>
              <td>{s.standard}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ViewStudent;
